Which method is called?
class Test {
    void print(int x) { System.out.println("int"); }
    void print(double x) { System.out.println("double"); }
}
new Test().print(5);,int,double,Compilation error,Ambiguous call

What is the output?
class Test {
    void display(String... args) {
        System.out.println(args.length);
    }
}
new Test().display("A", "B", "C");,3,1,0,Compilation error

What is the result?
class Box {
    private int size;
    public int getSize() { return size; }
    public void setSize(int s) { size = s; }
}
Box b = new Box();
b.size = 10;,Compilation error (private access),10,0,Runtime error

What happens with this immutable class?
final class Person {
    private final String name;
    Person(String n) { name = n; }
    public String getName() { return name; }
}
Person p = new Person("John");
p.name = "Jane";,Compilation error (private final field),Jane,John,Runtime error

